Jv/Rangsang Tuban (Hanacaraka)/Kaca 92 Alihaksara[edit] /kaca 092/ n sariranipun kuning anemu giring" ; (lolosipun raden udakawimba ; dereng ngagem rawis ; cemenging ; sarira ; amargi kekenṭang anggenipun anjenengi yaya~ ; dipun sarirani piyambak) ; sang prabu ; lajĕng aḍawuh mepak bala ; ho_ ter tiyang sanagari ; boten dangu ; sampun samapta ; ingkang dados cucuking lampah ; inggih senapatining prang pulranipun kyai patih ingkang sampun dados nayakaning praja ; nama raden lodaka ; sang prabu ; 
..........
angrampid kiṭa ; sang prabu gugup ; lajĕng amasang gelar ombaking samodra pasang ; sagung wadyabala ; tirata ambalabar angelebibi papan ; para bupati panjawat ; sang prabu kaliyan kyai patih wontĕn ing tengah ; raden udakawimba lajĕng malik gelar jurang gempal ; lajĕng perang brubuh ; bala ing tuban ingkang minangka toya ; mili ḍateng ingjejurang ; sima larut tanpa lari ; makaten upaminipun bala ing tuban ; kalebet ing gelar tanpa•budi ; kapikut ; sami asrah bongkokan ; sang prabu warihkusuma ;
